import React from 'react';
import './Footer.css'; // Import CSS for styling

function Footer() {
  return (
    <footer>
      <div className="footer-content">
        <div>
          <p>About Us: We are a company dedicated to providing quality services.</p>
        </div>
        <div>
          <p>Contact Details: Email: example@example.com | Phone: +1234567890</p>
        </div>
      </div>
    </footer>
  );
}

export default Footer;
